Verenigde Staten
Drama / Misdaad
97 minuten

goed

met Melissa Leo, Misty Upham en Charlie McDermott

De alleenstaande moeder Ray smokkelt samen met Lila, een van origine Mohawk Indiaanse, illegale immigranten over de grens van 
Canada naar de VS. Ze zweren dat iedere rit met hun pick-up truck over de bevroren rivier hun laatste is, totdat ze aan beide 
kanten in aanraking komen met de wet.
